import apiInstance from "../../shared/interceptors/axios.interceptor";
import routesApi from "../../shared/routes/routesApi.routes";
import { IEmployee } from "../models/IEmployee";

export const getAllEmploye = async () => {
  try {
    const resp = await apiInstance.get(`${routesApi.employe}`);
    if (resp.status === 200) return resp.data;
  } catch (err) {
    console.log(err);
  }
};

export const getIdEmploye = async (id: string) => {
  try {
    const resp = await apiInstance.get(`${routesApi.employe}${id}`);
    if (resp.status === 200) return resp.data;
  } catch (err) {
    console.log(err);
  }
};

export const postEmployee = async (form: IEmployee) => {
  try {
    const resp = await apiInstance.post(`${routesApi.employe}`, form);
    if (resp.status === 200) return resp.data;
  } catch (err) {
    console.log(err);
  }
};

export const putEmployee = async (form: IEmployee, id: string) => {
  try {
    const resp = await apiInstance.put(`${routesApi.employe}${id}`, form);
    if (resp.status === 200) return resp.data;
  } catch (err) {
    console.log(err);
  }
};

export const deleteEmploye = async (id: string) => {
  try {
    const resp = await apiInstance.delete(`${routesApi.employe}${id}`);
    if (resp.status === 200) return resp.data;
  } catch (err) {
    console.log(err);
  }
};
